{{html wiki=false clean=false}}
<style type="text/css">
#aceDemo {
  position: relative;
  width: 500px;
  height: 400px;
  overflow: visible;
}
</style>
<div id="aceDemo">some text</div>
<script src="$xwiki.zipexplorer.getFileLink($xwiki.getDocument('XWiki.Ace'), 'ace.zip', 'ace.js')" type="text/javascript" charset="utf-8"></script>
